import React from 'react';
import Axios from "axios";

class Homepage extends React.Component {
    componentDidMount() {
        console.log("res.data");
        Axios({
            method: "GET",
            withCredentials: true,
            url: "http://localhost:8080/",
          }).then((res) => {
            //setData(res.data);
            console.log(res);
        });
    }

    render() {
        return (
            <div>
                Homepage
            </div>
        );
    }
}

export default Homepage;
